import React, { useEffect, useState } from 'react';
import axios from 'axios';

function Output() {
    const [logs, setLogs] = useState([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        fetchLogs();
    }, []);

    const fetchLogs = async () => {
        try {
            const response = await axios.get('/output'); // Send a GET request to fetch logs
            console.log('Received1 Logs from backend:', response.data);
            console.log("found?"); // Log received data
            setLogs(response.data); // Set the received logs data
            setLoading(false);
        } catch (error) {
            console.error('Error fetching logs:', error);
            setLoading(false);
        }
    };

    if (loading) {
        return <div>Loading...</div>;
    }

    if (logs.length === 0) {
        return <div>No logs found</div>;
    }

    return (
        <div>
            {logs.map((logGroup, groupIndex) => (
                <div key={groupIndex}>
                    <p>Log Group {groupIndex + 1}</p>
                    <ul>
                        {logGroup.map((log, index) => (
                            <li key={index}>
                                <p>Src: {log.src}</p>
                                <p>Line Number: {log.lineNumber}</p>
                            </li>
                        ))}
                    </ul>
                </div>
            ))}
        </div>
    );
}

export default Output;
